One of the main components that a LibAFL-based fuzzer uses is the State, a container of the data that is evolved during the fuzzing process, such as the Corpus of inputs. In our main so we create a basic State instance like the following: // create a State from scratch
let mut state = StdState::new( // RNG StdRand::with_seed(current_nanos()), // Corpus that will be evolved, we keep it in memory for performance InMemoryCorpus::new(), // Corpus in which we store solutions (crashes in this example), // on disk so the user can get them after stopping the fuzzer OnDiskCorpus::new(PathBuf::from("./crashes")).unwrap(), (),
); It takes a random number generator, that is part of the fuzzer state, in this case, we use the default one StdRand but you can choose a different one. We seed it with the current nanoseconds. As the second parameter, it takes an instance of something implementing the Corpus trait, InMemoryCorpus in this case. The corpus is the container of the testcases evolved by the fuzzer, in this case, we keep it all in memory. We will discuss later the last parameter. The third is another corpus, in this case, to store the testcases that are considered as "solutions" for the fuzzer. For our purpose, the solution is the input that triggers the panic. In this case, we want to store it to disk under the crashes directory so we can inspect it. Another required component is the EventManager. It handles some events such as the addition of a testcase to the corpus during the fuzzing process. For our purpose, we use the simplest one that just displays the information about these events to the user using a Stats instance. // The Stats trait define how the fuzzer stats are reported to the user
let stats = SimpleStats::new(|s| println!("{}", s)); // The event manager handle the various events generated during the fuzzing loop
// such as the notification of the addition of a new item to the corpus
let mut mgr = SimpleEventManager::new(stats); In addition, we have the Fuzzer, an entity that contains some actions that alter the State. On of these actions is the scheduling of the testcases to the fuzzer using a CorpusScheduler. We create it as QueueCorpusScheduler, a scheduler that serves testcases to the fuzzer in a FIFO fashion. // A queue policy to get testcasess from the corpus
let scheduler = QueueCorpusScheduler::new(); // A fuzzer with feedbacks and a corpus scheduler
let mut fuzzer = StdFuzzer::new(scheduler, (), ()); Last but not least, we need an Executor that is the entity responsible to run our program under test. In this example, we want to run the harness function in process, and so we use the InProcessExecutor. // Create the executor for an in-process function
let mut executor = InProcessExecutor::new( &mut harness, (), &mut fuzzer, &mut state, &mut mgr,
)
.expect("Failed to create the Executor"); It takes a reference to the harness, the state, and the event manager. We will discuss the second parameter later. As the executor expects that the harness returns an ExitKind object, we add ExitKind::Ok to our harness function. Now we have the 4 major entities ready for running our tests, but we still cannot generate testcases. For this purpose, we use a Generator, RandPrintablesGenerator that generates a string of printable bytes. // Generator of printable bytearrays of max size 32
let mut generator = RandPrintablesGenerator::new(32); // Generate 8 initial inputs
state .generate_initial_inputs(&mut executor, &mut generator, &mut mgr, &scheduler, 8) .expect("Failed to generate the initial corpus".into()); Now you can prepend the following use directives to your main.rs and compile it. use std::path::PathBuf;
use libafl::{ bolts::{current_nanos, rands::StdRand}, corpus::{InMemoryCorpus, OnDiskCorpus, QueueCorpusScheduler}, events::SimpleEventManager, executors::{inprocess::InProcessExecutor, ExitKind}, generators::RandPrintablesGenerator, state::StdState, stats::SimpleStats,
}; When running, you should see something similar to: $ cargo run Finished dev [unoptimized + debuginfo] target(s) in 0.04s Running `target/debug/baby_fuzzer`
[LOG Debug]: Loaded 0 over 8 initial testcases

