Now you simply ran 8 randomly generated testcases but none of them has been stored in the corpus. If you are very lucky, maybe you triggered the panic by chance but you don't see any saved file in crashes. Now we want to turn our simple fuzzer into a feedback-based one and increase the chance to generate the right input to trigger the panic. We are going to implement a simple feedback based on the 3 conditions that are needed to reach the panic. To do that, we need a way to keep track of if a condition is satisfied. The component that feeds the fuzzer with information about properties of a fuzzing run, the satisfied conditions in our case, is the Observer. We use the StdMapObserver, the default observer that uses a map to keep track of covered elements. In our fuzzer, each condition is mapped to an entry of such map. We represent such map as a static mut variable: // Coverage map with explicit assignments due to the lack of instrumentation
static mut SIGNALS: [u8; 16] = [0; 16]; fn signals_set(idx: usize) { unsafe { SIGNALS[idx] = 1 };
} As we don't rely on any instrumentation engine, we have to manually track the satisfied conditions in a map modyfing our tested function: // The closure that we want to fuzz
let mut harness = |buf: &[u8]| { signals_set(0); if buf.len() > 0 && buf[0] == 'a' as u8 { signals_set(1); if buf.len() > 1 && buf[1] == 'b' as u8 { signals_set(2); if buf.len() > 2 && buf[2] == 'c' as u8 { panic!("=)"); } } } ExitKind::Ok
}; The observer can be created directly from the SIGNALS map, in the following way: // Create an observation channel using the signals map
let observer = StdMapObserver::new("signals", unsafe { &mut SIGNALS }); The observers are usually kept in the corresponding executor as they keep track of information that is valid for just one run. We have then to modify our InProcessExecutor creation to include the observer as follows: // Create the executor for an in-process function with just one observer
let mut executor = InProcessExecutor::new(&mut harness, tuple_list!(observer), &mut state, &mut mgr) .expect("Failed to create the Executor".into()); Now that the fuzzer can observe which condition is satisfied, we need a way to rate an input as interesting (i.e. worth of addition to the corpus) based on this observation. Here comes the notion of Feedback. The Feedback is part of the State and provides a way to rate input and its corresponding execution as interesting looking for the information in the observers. Feedbacks can maintain a cumulative state of the information seen so far in a so-called FeedbackState instance, in our case it maintains the set of conditions satisfied in the previous runs. We use MaxMapFeedback, a feedback that implements a novelty search over the map of the MapObserver. Basically, if there is a value in the observer's map that is greater than the maximum value registered so far for the same entry, it rates the input as interesting and updates its state. Feedbacks are used also to decide if an input is a "solution". The feedback that does that is called the Objective Feedback and when it rates an input as interested it is not saved to the corpus but to the solutions, written in the crashes folder in our case. We use the CrashFeedback to tell the fuzzer that if an input causes the program to crash it is a solution for us. We need to update our State creation including the feedback state and the Fuzzer including the feedback and the objective: // The state of the edges feedback.
let feedback_state = MapFeedbackState::with_observer(&observer); // Feedback to rate the interestingness of an input
let feedback = MaxMapFeedback::new(&feedback_state, &observer); // A feedback to choose if an input is a solution or not
let objective = CrashFeedback::new(); // create a State from scratch
let mut state = StdState::new( // RNG StdRand::with_seed(current_nanos()), // Corpus that will be evolved, we keep it in memory for performance InMemoryCorpus::new(), // Corpus in which we store solutions (crashes in this example), // on disk so the user can get them after stopping the fuzzer OnDiskCorpus::new(PathBuf::from("./crashes")).unwrap(), // States of the feedbacks. // They are the data related to the feedbacks that you want to persist in the State. tuple_list!(feedback_state),
); // ... // A fuzzer with feedbacks and a corpus scheduler
let mut fuzzer = StdFuzzer::new(scheduler, feedback, objective);

